let count = {
    counter: 0
}
export const CreateReducer = (state = count, action) => {
    if(action.type === "increment") {
        return count.counter + 1
    }
    if(action.type === "decrement") {
        return count.counter - 1
    }
    if(action.type === "reset") {
        return {counter: 0}
    }
    return state
}
